import React from 'react';
import { Link } from 'react-router-dom';
import ap from './24e8f08ba83e34213572acbdb1061bf0.jpg';
import std from './Interior-TR-INT2-architecture-01-1-Kindesign.jpg';

const PropertyListPage = () => {
  // Simulated property data
  const properties = [
    { id: 1, name: 'Luxury Apartment', price: '$500,000', image:{ap}},
    { id: 2, name: 'Cozy Studio', price: '$200,000', image:{std}},
    { id: 3, name: 'Office Place', price: '$800,000', image:'./i6CP8wXP2fD-02.18.2018_20.17.48.jpg' }

  ];

  return (
    <div className="property-list">
      <h2>Available Properties</h2>
      <div className="property-grid">
        {properties.map((property) => (
          <div key={property.id} className="property-card">
            <img src={property.image} alt={property.name} className="property-card-image" />
            <h3>{property.name}</h3>
            <p>{property.price}</p>
            <Link to={`/properties/${property.id}`}>View Details</Link>
          </div>
        ))}
      </div>
    </div>
  );
};

export default PropertyListPage;
